  const [inputText, setInputText] = useState("");
  const [todos, setTodos] = useState([]);

  return (
    <div clasName='App'>
      <header>

        <h1>My ToDo List </h1>
      </header>
      <Form setInputText={setInputText}todos={todos} setTodos={setTodos}inputText={inputText}/>
      <Todolist></Todolist>
      <Todo></Todo>
    </div>
  );
}

export default App;
